import{_ as h,a as e,b as t,c as a,d as c,e as i,f as o,g as r,h as p,i as d,j as m,k as s,l,m as n,n as g,o as u,p as f,q as b,r as v,s as w,t as _,u as y,v as k,w as x,x as q,y as T,z as I,A as P,B as F,C as S}from"./chunks/logged_messages.BLmINYgI.js";import{_ as R,c as D,o as z,ab as V}from"./chunks/framework.CUflZczI.js";const B=JSON.parse('{"title":"使用 Flight Review 进行日志分析","description":"","frontmatter":{},"headers":[],"relativePath":"zh/log/flight_review.md","filePath":"zh/log/flight_review.md"}'),L={name:"zh/log/flight_review.md"},G=V('<h1 id="使用-flight-review-进行日志分析" tabindex="-1">使用 Flight Review 进行日志分析 <a class="header-anchor" href="#使用-flight-review-进行日志分析" aria-label="Permalink to &quot;使用 Flight Review 进行日志分析&quot;">​</a></h1><p><a href="http://logs.px4.io" target="_blank" rel="noreferrer">飞行复查</a>可以绘制图表来分析一般的车辆状况。</p><p>这些图是不言自明的，但是需要一些经验来了解哪些范围是可以接受的，以及一个图应该是什么样的。 本页介绍如何解释这些情节并识别常见问题。</p><h2 id="一般用法" tabindex="-1">一般用法 <a class="header-anchor" href="#一般用法" aria-label="Permalink to &quot;一般用法&quot;">​</a></h2><p>许多图形共有的功能:</p><ul><li>Plot background color is used to indicate flight mode during recording (where graphs depend on mode): <img src="'+h+'" alt="飞行模式"><ul><li><strong>Flight mode:</strong> Background colour on the body of the plot indicates flight mode. 将鼠标悬停在绘图上将显示飞行模式标签。</li><li><strong>VTOL flight mode:</strong> VTOL vehicles additionally show the VTOL mode as background colour in the bottom part of the plot (blue for multicopter, yellow for fixed-wing, and red for transition).</li></ul></li><li>鼠标在特定的绘图轴上滚动可缩放该轴 (水平或垂直)。</li><li>鼠标在图形内滚动可缩放两个轴。</li></ul><p><a id="tracking"></a></p><h2 id="pid-性能跟踪" tabindex="-1">PID 性能跟踪 <a class="header-anchor" href="#pid-性能跟踪" aria-label="Permalink to &quot;PID 性能跟踪&quot;">​</a></h2><p>根据飞行模式, 车辆控制器可能会尝试跟踪位置、速度、高度或速率设定值 (跟踪的设定值取决于模式, 例如: 在稳定模式下没有速度设定值)。</p><p>The <strong>Estimated</strong> line (red) should closely match with the <strong>Setpoint</strong> (green). 如果没有，在大多数情况下，需要调整该控制器的 PID 增益。</p><p><a href="./../config_mc/pid_tuning_guide_multicopter.html">多轴 PID 调优指南</a>包含示例图和有关分析跟踪性能的信息。</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>For the rate controller in particular, it is useful to enable the high-rate logging profile (<a href="./../advanced_config/parameter_reference.html#SDLOG_PROFILE">SDLOG_PROFILE</a>) to get more details when zooming in.</p></div><h2 id="振动" tabindex="-1">振动 <a class="header-anchor" href="#振动" aria-label="Permalink to &quot;振动&quot;">​</a></h2><p>Vibration is one of the most common problems for multirotor vehicles. High vibration levels can lead to:</p><ul><li>飞行效率低, 飞行时间缩短</li><li>电机温度升高</li><li>增加材料磨损</li><li>无法严格调整车辆，导致飞行性能下降。</li><li>传感器接线</li><li>位置估计失败，可能偏离飞行。</li></ul><p>It is therefore important to keep an eye on the vibration levels and improve the setup if needed.</p><p>There is a point where vibration levels are clearly too high, and generally lower vibration levels are better. However there is a broad range between &#39;everything is ok&#39; and &#39;the levels are too high&#39;. This range depends on a number of factors, including vehicle size - as larger vehicles have higher inertia, allowing for more software filtering (at the same time the vibrations on larger vehicles are of lower frequency).</p><p>The following paragraphs and sections provide information about what plots to use for checking vibration levels, and how to analyse them.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>It is worth looking at multiple charts when analyzing vibration (different charts can better highlight some issues).</p></div><h3 id="fft-制动器控制" tabindex="-1">FFT 制动器控制 <a class="header-anchor" href="#fft-制动器控制" aria-label="Permalink to &quot;FFT 制动器控制&quot;">​</a></h3><div class="info custom-block"><p class="custom-block-title">You need to enable the high-rate logging profile (<a href="./../advanced_config/parameter_reference.html#SDLOG_PROFILE">SDLOG_PROFILE</a>) to see this plot.</p></div><p>This graph shows a frequency plot for the roll, pitch and yaw axis based on the actuator controls signal (the PID output from the rate controller). It helps to identify frequency peaks and configuring the software filters. There should only be a single peak at the lowest end (below around 20 Hz), the rest should be low and flat.</p><p>Note that the y-axis scaling is different for different vehicles, but logs from the same vehicle can be directly compared to each other.</p><h4 id="例子-良好的振动" tabindex="-1">例子：良好的振动 <a class="header-anchor" href="#例子-良好的振动" aria-label="Permalink to &quot;例子：良好的振动&quot;">​</a></h4><p><a href="./../frames_multicopter/qav_r_5_kiss_esc_racer.html">QAV-R 5&quot; Racer</a> frame (excellent vibration).</p><p><img src="'+e+'" alt="Low vibration QAV-R 5 Racer - FFT plot"></p><div class="info custom-block"><p class="custom-block-title">The excellent vibration characteristics of the above frame mean that we can considerably increase the cutoff frequency of the <a href="./../config_mc/filter_tuning.html">software filters</a> (reducing control latency).</p></div><p>DJI F450 frame (good vibration).</p><p><img src="'+t+'" alt="Low vibration DJI F450 - FFT plot"></p><p>S500 frame:</p><p><img src="'+a+'" alt="Low vibration S500 actuator controls - FFT plot"></p><div class="info custom-block"><p class="custom-block-title">While the plot above looks good, the <a href="#raw_acc_s500">Raw Acceleration graph for the same flight</a> shows that the vibration levels are a bit high for x and y. This is a good example of why it is worth checking several graphs!</p></div><h4 id="例子-不好的振动" tabindex="-1">例子：不好的振动 <a class="header-anchor" href="#例子-不好的振动" aria-label="Permalink to &quot;例子：不好的振动&quot;">​</a></h4><p>This example shows a peak in frequency close to 50 Hz (in this case due to &quot;loose&quot; landing gear).</p><p><img src="'+c+'" alt="Vibrations in landing gear - FFT plot"></p><h3 id="加速度功率谱密度" tabindex="-1">加速度功率谱密度 <a class="header-anchor" href="#加速度功率谱密度" aria-label="Permalink to &quot;加速度功率谱密度&quot;">​</a></h3><p>This is a 2D frequency plot showing the frequency response of the raw accelerometer data over time (it displays the sum for the x, y and z axis). The more yellow an area is, the higher the frequency response at that time and frequency.</p><p>Ideally only the lowest part up to a few Hz is yellow, and the rest is mostly green or blue.</p><h4 id="例子-良好的振动-1" tabindex="-1">例子：良好的振动 <a class="header-anchor" href="#例子-良好的振动-1" aria-label="Permalink to &quot;例子：良好的振动&quot;">​</a></h4><p><a href="./../frames_multicopter/qav_r_5_kiss_esc_racer.html">QAV-R 5&quot; Racer</a> frame (excellent vibration).</p><p><img src="'+i+'" alt="Low vibration QAV-R 5 Racer - spectral density plot"></p><p>DJI F450 frame (good vibration). <img src="'+o+'" alt="Low vibration DJI F450 - spectral density plot"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Above you can see the blade passing frequency of the propellers at around 100 Hz.</p></div><p>S500 frame: <img src="'+r+'" alt="Vibration S500 - spectral density plot"></p><h4 id="例子-不好的振动-1" tabindex="-1">例子：不好的振动 <a class="header-anchor" href="#例子-不好的振动-1" aria-label="Permalink to &quot;例子：不好的振动&quot;">​</a></h4><p>The strong yellow lines at around 100Hz indicate a potential issue that requires further investigation (starting with a review of the other charts).</p><p><img src="'+p+'" alt="High vibration in spectral density plot"></p><p>This plot below shows a peak in frequency close to 50 Hz (in this case due to &quot;loose&quot; landing gear).</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>This indicates a possible problem because it is a strong single low frequency that is close to the vehicle dynamics. With the default filter settings of 80 Hz vibrations at 50 Hz will not be filtered.</p></div><p><img src="'+d+'" alt="Vibrations in landing gear - spectral density plot"></p><p>Extremely high (unsafe) vibration! Note that the graph is almost completely yellow.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>You should not fly with such high vibration levels.</p></div><p><img src="'+m+'" alt="Exceedingly high vibration in spectral density plot"></p><h3 id="原始加速度" tabindex="-1">原始加速度 <a class="header-anchor" href="#原始加速度" aria-label="Permalink to &quot;原始加速度&quot;">​</a></h3><p>This graph shows the raw accelerometer measurements for the x, y and z axis. Ideally each line is thin and clearly shows the vehicle&#39;s accelerations.</p><p>As a rule of thumb if the z-axis graph is touching the x/y-axis graph during hover or slow flight, the vibration levels are too high.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>The best way to use this graph is to zoom in a bit to a part where the vehicle is hovering.</p></div><h4 id="例子-良好的振动-2" tabindex="-1">例子：良好的振动 <a class="header-anchor" href="#例子-良好的振动-2" aria-label="Permalink to &quot;例子：良好的振动&quot;">​</a></h4><p><a href="./../frames_multicopter/qav_r_5_kiss_esc_racer.html">QAV-R 5&quot; Racer</a> frame (excellent vibration).</p><p><img src="'+s+'" alt="Low vibration QAV-R 5 Racer - raw accel. 绘图"></p><p>DJI F450 frame (good vibration). <img src="'+l+'" alt="Low vibration DJI F450 - raw accel. 绘图"></p><h4 id="例子-不好的振动-2" tabindex="-1">例子：不好的振动 <a class="header-anchor" href="#例子-不好的振动-2" aria-label="Permalink to &quot;例子：不好的振动&quot;">​</a></h4><p><a id="raw_acc_s500"></a> S500 frame. Borderline vibration levels - a bit high for x and y (which is typical for an S500 airframe). 这是它开始对飞行性能产生负面影响的极限。</p><p><img src="'+n+'" alt="Borderline vibration S500 x, y - raw accel. 绘图"></p><p>Vibration too high. Note how the graph of the z-axis overlaps with the x/y-axis graph:</p><p><img src="'+g+'" alt="Vibrations in landing gear - raw accel. 绘图"></p><p>Vibration levels are too high. Note how the graph of the z-axis overlaps with the x/y-axis graph:</p><p><img src="'+u+'" alt="High vibration in raw accel. 绘图"></p><p>Very high (unsafe) vibration levels.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>You should not fly with such high vibration levels.</p></div><p><img src="'+f+'" alt="Exceedingly high vibration in raw accel. 绘图"></p><p><a id="fifo_logging"></a></p><h3 id="raw-high-rate-imu-data-plots" tabindex="-1">Raw High-rate IMU Data Plots <a class="header-anchor" href="#raw-high-rate-imu-data-plots" aria-label="Permalink to &quot;Raw High-rate IMU Data Plots&quot;">​</a></h3><p>For an in-depth analysis there is an option to log the raw IMU data at full rate (several kHz, depending on the IMU). This allows inspection of much higher frequencies than with normal logging, which can help when selecting vibration mounts or configuring low-pass and notch filters appropriately.</p><p>To use it, some parameters need to be changed:</p><ul><li>Set <a href="./../advanced_config/parameter_reference.html#IMU_GYRO_RATEMAX">IMU_GYRO_RATEMAX</a> to 400. This ensures that the raw sensor data is more efficiently packed when sent from the sensor to the rest of the system, and reduces the log size (without reducing useful data). </li><li>Use a good SD card, as the IMU data requires a high logging bandwidth (Flight Review will show dropouts if the logging rate gets too high).</li></ul><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>See <a href="./../dev_log/logging.html#sd-cards">Logging &gt; SD Cards</a> for a comparison of popular SD card.</p></div><ul><li>Enable either the gyro or accel high-rate FIFO profile in <a href="./../advanced_config/parameter_reference.html#SDLOG_PROFILE">SDLOG_PROFILE</a> and disable the rest of the entries. If you are using a really good SD card (seeing few/no dropouts), you can: <ul><li>either enable both accel and gyro profiles</li><li>or enable accel/gyro plus the default logging profile</li></ul></li></ul><p>Example plot:</p><p><img src="'+b+'" alt="high-rate accel power spectral density"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Data of the first IMU is logged, which is not necessarily the same as the one used for flying. This is mostly only important in cases where IMU&#39;s are mounted differently (e.g. hard-mounted vs. soft-mounted).</p></div><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Do not forget to restore the parameters after testing.</p></div><p><a id="solutions"></a></p><h3 id="fixing-vibration-problems" tabindex="-1">Fixing Vibration Problems <a class="header-anchor" href="#fixing-vibration-problems" aria-label="Permalink to &quot;Fixing Vibration Problems&quot;">​</a></h3><p>Often a source of vibration (or combination of multiple sources) cannot be identified from logs alone.</p><p>In this case the vehicle should be inspected. <a href="./../assembly/vibration_isolation.html">Vibration Isolation</a> explains some basic things you can check (and do) to reduce vibration levels.</p><h2 id="制动器输出" tabindex="-1">制动器输出 <a class="header-anchor" href="#制动器输出" aria-label="Permalink to &quot;制动器输出&quot;">​</a></h2><p>The <em>Actuator Outputs</em> graph shows the signals that are sent to the individual actuators (motors/servos). Generally it is in the range between the minimum and maximum configured PWM values (e.g. from 1000 to 2000).</p><p>This is an example for a quadrotor where everything is OK (all of the signals are within the range, approximately overlap each other, and are not too noisy): <img src="'+v+'" alt="Good actuator outputs"></p><p>The plot can help to identify different problems:</p><ul><li><p>If one or more of the signals is at the maximum over a longer time, it means the controller runs into <strong>saturation</strong>. 这并不一定是一个问题，例如在全速飞行时，这是意料之中的。 但如果它发生了，例如在一次任务中，这是一个信号，表明飞行器超重，无法提供足够的推力。</p></li><li><p>For a multicopter the plot can be a good indication if the vehicle is <strong>imbalanced</strong>. 它在图中显示，一个或多个相邻的电机 (一个四旋翼的情况下是两个) 平均需要以更高的推力运行。 请注意，如果某些电机提供的推力大于其他电机，或者 ESCs 没有经过校准，也可能出现这种情况。 一个不平衡的车辆通常不是一个大问题，因为自动驾驶仪将自动解释它。 然而，它减少了最大的可实现的推力，并会给一些电机带来更大的压力，因此，飞机最好是平衡的。</p></li><li><p>不平衡也有可能来自偏航的轴心。 这图与前一种情况类似，但是相反的电机将分别运行得更高或更低。 原因可能是一个或多个电机倾斜。</p><p>这是一个六轴电机的例子：电机 1、3 和 6 运行的推力更高： <img src="'+w+'" alt="Hexrotor imbalanced actuator outputs"></p></li><li><p>If the signals look very <strong>noisy</strong> (with high amplitudes), it can have two causes: sensor noise or vibrations passing through the controller (this shows up in other plots as well, see previous section) or too high PID gains. 这是一个极端的例子： <img src="'+_+'" alt="嘈杂的致动器输出 - 极端情况"></p></li></ul><h2 id="gps-不确定性" tabindex="-1">GPS 不确定性 <a class="header-anchor" href="#gps-不确定性" aria-label="Permalink to &quot;GPS 不确定性&quot;">​</a></h2><p>The <em>GPS Uncertainty</em> plot shows information from the GPS device:</p><ul><li>使用卫星的数目 (应大约或多余 12 个)</li><li>水平位置精确度（应小于 1 米）</li><li>垂直位置精确度 (应小于 2 米)</li><li>GPS fix: this is 3 for a 3D GPS fix, 4 for GPS + Dead Reckoning, 5 for RTK float and 6 for RTK fixed type</li></ul><h2 id="gps-噪声和干扰" tabindex="-1">GPS 噪声和干扰 <a class="header-anchor" href="#gps-噪声和干扰" aria-label="Permalink to &quot;GPS 噪声和干扰&quot;">​</a></h2><p>The GPS Noise &amp; Jamming plot is useful to check for GPS signal interferences and jamming. The GPS signal is very weak and thus it can easily be disturbed/jammed by components transmitting (via cable) or radiating in a frequency used by the GPS.</p><div class="tip custom-block"><p class="custom-block-title">USB</p><p>3 is <a href="https://www.usb.org/sites/default/files/327216.pdf" target="_blank" rel="noreferrer">known to be</a> an effective GPS jamming source.</p></div><p>The <strong>jamming indicator</strong> should be around or below 40. Values around 80 or higher are too high and the setup must be inspected. Signal interference is also noticeable as reduced accuracy and lower number of satellites up to the point where no GPS fix is possible.</p><p>This is an example without any interference:</p><p><img src="'+y+'" alt="GPS jamming - good plot"></p><h2 id="推力和磁场" tabindex="-1">推力和磁场 <a class="header-anchor" href="#推力和磁场" aria-label="Permalink to &quot;推力和磁场&quot;">​</a></h2><p>The <em>Thrust and Magnetic Field</em> plot shows the thrust and the norm of the magnetic sensor measurement vector.</p><p>The norm should be constant over the whole flight and uncorrelated with the thrust. This is a good example where the norm is very close to constant: <img src="'+k+'" alt="Thrust and mag close to constant"></p><p><em>If it is correlated</em>, it means that the current drawn by the motors (or other consumers) is influencing the magnetic field. This must be avoided as it leads to incorrect yaw estimation. The following plot shows a strong correlation between the thrust and the norm of the magnetometer: <img src="'+x+'" alt="Correlated thrust and mag"></p><p>Solutions to this are:</p><ul><li>使用外部磁强计 (避免使用内部磁强计)</li><li>如果使用外部磁强计，将其移到离强电流较远的地方(例如，使用 (较长的) GPS 天线)。</li></ul><p>If the norm is uncorrelated but not constant, most likely it is not properly calibrated. However it could also be due to external disturbances (for example when flying close to metal constructs).</p><p>This example shows that the norm is non-constant, but it does not correlate with the thrust: <img src="'+q+'" alt="Uncorrelated thrust and mag"></p><h2 id="估计器看门狗" tabindex="-1">估计器看门狗 <a class="header-anchor" href="#估计器看门狗" aria-label="Permalink to &quot;估计器看门狗&quot;">​</a></h2><p>The <em>Estimator Watchdog</em> plot shows the health report of the estimator. It should be constant zero.</p><p>This is what it should look like if there are no problems: <img src="'+T+'" alt="Estimator watchdog - good"></p><p>If one of the flags is non-zero, the estimator detected a problem that needs to be further investigated. Most of the time it is an issue with a sensor, for example magnetometer interferences. It usually helps to look at the plots of the corresponding sensor.</p><p>Here is an example with magnetometer problems: <img src="'+I+'" alt="Estimator watchdog with magnetometer problems"></p><h2 id="传感器数据的采样规律性" tabindex="-1">传感器数据的采样规律性 <a class="header-anchor" href="#传感器数据的采样规律性" aria-label="Permalink to &quot;传感器数据的采样规律性&quot;">​</a></h2><p>The sampling regularity plot provides insights into problems with the logging system and scheduling.</p><p>The amount of <strong>logging dropouts</strong> start to increase if the log buffer is too small, the logging rate is too high or a low-quality SD card is used.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Occasional dropouts can be expected on medium quality cards.</p></div><p>The <strong>delta t</strong> shows the time difference between two logged IMU samples. It should be close to 4 ms because the data publishing rate is 250Hz. If there are spikes that are a multiple of that (and the estimator time slip does not increase), it means the logger skipped some samples. Occasionally this can happen because the logger runs at lower priority. If there are spikes that are not a multiple, it indicates an irregular sensor driver scheduling, which needs to be investigated.</p><p>The <strong>estimator timeslip</strong> shows the difference between the current time and the time of the integrated sensor intervals up to that time. If it changes it means either the estimator missed sensor data or the driver publishes incorrect integration intervals. It should stay at zero, but it can increase slightly for in-flight parameter changes, which is generally not an issue.</p><p>This is a good example: <img src="'+P+'" alt="Sampling regularity good"></p><p>The following example contains too many dropouts, the quality of the used SD card was too low in that case (see <a href="./../dev_log/logging.html#sd-cards">here</a> for good SD cards):</p><p><img src="'+F+'" alt="Many Dropouts"></p><h2 id="日志报文" tabindex="-1">日志报文 <a class="header-anchor" href="#日志报文" aria-label="Permalink to &quot;日志报文&quot;">​</a></h2><p>This is a table with system error and warning messages. For example they show when a task becomes low on stack size.</p><p>The messages need to be examined individually, and not all of them indicate a problem. For example the following shows a kill-switch test: <img src="'+S+'" alt="日志报文"></p><h2 id="飞行-帧-日志审查实例" tabindex="-1">飞行/帧 日志审查实例 <a class="header-anchor" href="#飞行-帧-日志审查实例" aria-label="Permalink to &quot;飞行/帧 日志审查实例&quot;">​</a></h2><p>It is often worth looking at multiple charts for a particular flight when analyzing vehicle condition (different charts can better highlight some issues). This is particularly important when reviewing for possible vibration problems.</p><p>The section below groups a few (previously presented) charts by flight/vehicle.</p><h3 id="qav-r-5-racer" tabindex="-1">QAV-R 5&quot; Racer <a class="header-anchor" href="#qav-r-5-racer" aria-label="Permalink to &quot;QAV-R 5&quot; Racer&quot;">​</a></h3><p>These charts are all from the same flight of a <a href="./../frames_multicopter/qav_r_5_kiss_esc_racer.html">QAV-R 5&quot; Racer</a>.</p><p>They show a vehicle that has very low vibration:</p><ul><li>致动器控制 FFT 显示，只在结束部分有一个最低的峰值，剩下的地方都很低且平坦。</li><li>谱密度大多为绿色，低频率只有很小的黄色。</li><li>原始加速度的 z 轴轨迹与 x/y 轴轨迹很好地分离开了。</li></ul><p><img src="'+e+'" alt="Low vibration QAV-R 5 Racer - FFT plot"></p><p><img src="'+i+'" alt="Low vibration QAV-R 5 Racer - spectral density plot"></p><p><img src="'+s+'" alt="Low vibration QAV-R 5 Racer - raw accel. 绘图"></p><h3 id="dji-f450" tabindex="-1">DJI F450 <a class="header-anchor" href="#dji-f450" aria-label="Permalink to &quot;DJI F450&quot;">​</a></h3><p>These charts are all from the same flight of a <em>DJI F450</em>.</p><p>They show a vehicle that has low vibration (but not as low as the QAV-R above!):</p><ul><li>致动器控制FFT在最底层显示峰值。 其余的大部分是平的，除了在 100Hz 左右有一个凸起 (这是螺旋桨的叶片通过频率) 。</li><li>光谱密度大多为绿色。 叶片通过频率再次可见。</li><li>原始加速度的 z 轴轨迹与 x/y 轴轨迹很好地分离开了。</li></ul><p><img src="'+t+'" alt="Low vibration DJI F450 - FFT plot"></p><p><img src="'+o+'" alt="Low vibration DJI F450 - spectral density plot"></p><p><img src="'+l+'" alt="Low vibration DJI F450 - raw accel. 绘图"></p><h3 id="s500" tabindex="-1">S500 <a class="header-anchor" href="#s500" aria-label="Permalink to &quot;S500&quot;">​</a></h3><p>These charts are all from the same flight of an S500.</p><p>They show a vehicle that has borderline-acceptable vibration:</p><ul><li>致动器控制FFT在最底层显示峰值。 其余大部分都是平的，除了在 100Hz 左右有一个突起。</li><li>光谱密度大多为绿色，但比DJI F450 在 100Hz 时更黄。</li><li>原始加速度的 z 轴轨迹与 x/y 轴轨迹非常接近。 这是它开始对飞行性能产生负面影响的极限。</li></ul><p><img src="'+a+'" alt="Low vibration S500 actuator controls - FFT plot"></p><p><img src="'+r+'" alt="Vibration S500 - spectral density plot"></p><p><img src="'+n+'" alt="Borderline vibration S500 x, y - raw accel. 绘图"></p>',149),O=[G];function A(H,E,M,N,J,U){return z(),D("div",null,O)}const C=R(L,[["render",A]]);export{B as __pageData,C as default};
